//decode所需函数

//初始化解码所需的参数
void raptor_init(uint32 k,uint32 n, RParam_dec parameter){
    parameter->K = k;
    parameter->S = S[k];
    parameter->H = H[k];
    parameter->L = parameter->K+parameter->S+parameter->H;
    parameter->N = n;	//接收到的分片数
    parameter->Amat_dec =  (mymatrix)malloc(sizeof(MyMatrix));
    matrix_init(parameter->S+parameter->H+n,parameter->L,parameter->Amat_dec);//初始化所需矩阵
    parameter->list = (uint16*)malloc(n*sizeof(uint16));//分片的esi列表
}

//解码函数
uint32 raptor_decode(RParam_dec parameter, uint8* input, uint8* output_return, uint32 T){
    raptor_intermediate(parameter);//计算矩阵的值
    int stepont = matrix_equations(parameter->Amat_dec, input, T);//高斯消元法 通过将原矩阵化为单位矩阵的过程将输入的symbols恢复成intermediate symbols
    if(stepont == 0)
        return 0;
    uint32 temp;
    uint8** mat = parameter->Amat_dec->rowpoint;
    uint8* output;
    output = (uint8*)malloc(parameter->L*T);
    memset(output, 0, parameter->L*T);
    /////////
    /*for(uint32 i=0; i<parameter->M; i++){
    printf("%d ",(int)*(input+i*T));
    }
    printf("\n");*/
    ///////////////

    triple trp;
    trp = (triple)malloc(sizeof(Triple));
    int l1 = L1[parameter->K];
    for(uint32 i = 0;i<parameter->K;i++){//求出intermediate symbols与填充零后的source symbols相关联的LT矩阵 也就是编码时声称的A矩阵
        memset(mat[i+parameter->S+parameter->H], 0, parameter->L);
        ////////////////

        ///////////////
        trip(parameter->K,i,trp);
        while(trp->b>=parameter->L)
            trp->b = (trp->b+trp->a)%l1;
        mat[i+parameter->S+parameter->H][trp->b] = 1;
        temp = (uint32)min(trp->d-1,parameter->L-1);
        for(uint32 j = 1;j<=temp;j++){
            trp->b = (trp->b+trp->a)%l1;
            while (trp->b>=parameter->L)
                trp->b = (trp->b+trp->a)%l1;
            mat[i+parameter->S+parameter->H][trp->b] = 1;
        }

        /*for(uint32 m = 0;m<parameter->M;m++){
        for(uint32 k = 0; k<parameter->L; k++){
        printf("%2d ",(int)parameter->Amat_dec->rowpoint[m][k]);
        }
        printf("\n");
        }
        printf("\n");*/
     }
    free(trp);
    trp = NULL;
    ///////////
    /*for(uint32 i = 0;i<parameter->M;i++){
    for(uint32 j = 0; j<parameter->L; j++){
    printf("%2d ",(int)parameter->Amat_dec->rowpoint[i][j]);
    }
    printf("\n");
    }
    printf("\n");*/
    /////////////////
    for(uint32 j=0; j<parameter->L; j++){//根据A矩阵恢复source symbols
        for(uint32 i=0; i<parameter->L; i++){
            if(parameter->Amat_dec->rowpoint[j][i] == 1)
                my_xor(output+j*T , input+i*T, T);
        }
        //printf("%d ",(int)(output+j*T)[0]);
    }
    //printf("\n");

    memcpy(output_return, output+(parameter->H+parameter->S)*T, parameter->K*T);
    free(output);
    return 1;
}

static void raptor_intermediate(RParam_dec parameter){
    uint8 **mat;
    mat = parameter->Amat_dec->rowpoint;
    uint32 i;
    //LDPC矩阵
    raptor_getLDPC(parameter);//与编码时的A内容相同
    //I_S单位矩阵
    for(i=0; i<parameter->S; i++){
        mat[i][i+parameter->K] = 1;
    }
    //Half矩阵
    raptor_getH(parameter);//与编码时的A内容相同
    //I_H单位矩阵
    for(i = 0; i<parameter->H;i++)
        mat[i+parameter->S][parameter->K+parameter->S+i] = 1;
    //LT矩阵
    raptor_getLT(parameter);//与编码时的A的生成方法相同但内容不同 根据相应recieved symbols的esi生成相应的LT矩阵
}

static void raptor_getLDPC(RParam_dec parameter){
    uint32 i,a,b;
    uint8** mat = parameter->Amat_dec->rowpoint;
    for(i = 0; i<parameter->K; i++){
        a = 1+((i/parameter->S)%(parameter->S-1));
        //	printf("a:%d   i:%d",a,i);//(int)floor(((double)i)/parameter->S)%(parameter->S-1);
        b = i%parameter->S;
        //	printf(" b:%d",b);
        mat[b][i] = 1;
        b = (b+a)%parameter->S;
        //	printf(" b:%d",b);
        mat[b][i] = 1;
        b = (b+a)%parameter->S;
        //	printf(" b:%d\n",b);
        mat[b][i] = 1;
    }
}

static void raptor_getH(RParam_dec parameter){
    uint32 h,j,count_1=0,count_j=0;
    uint16 temp = 0;
    uint8** mat = parameter->Amat_dec->rowpoint;
    float h1 = (float)ceil(parameter->H/2.0);
    for(h = 0; h<parameter->H; h++){
        for(j = 0; j<parameter->K+parameter->S; j++){
            temp = gray_m(j,h1);
            //	printf("temp:%d  h:%d\n",(int)temp,h);
            if(h == 0){
                if((temp&(uint16)1) ==1)
                    mat[parameter->S+h][j] = 1;
            }
            else{
                if(temp&1<<h){
                    mat[parameter->S+h][j] = 1;
                    //				printf("h:%d     j:%d\n",h,j);
                }
            }
        }
    }
}

static void raptor_getLT(RParam_dec parameter){
    uint32 i;
    uint8** mat = parameter->Amat_dec->rowpoint;
    triple trp;
    trp = (triple)malloc(sizeof(Triple));
    int l1 = L1[parameter->K];
    for(i = 0;i<parameter->N;i++){
        trip(parameter->K,parameter->list[i],trp);
        /*while(trp->b>=parameter->L)
            trp->b = (trp->b+trp->a)%l1;
        mat[i+parameter->S+parameter->H][trp->b] = 1;
        temp = (uint32)min(trp->d-1,parameter->L-1);
        for(j = 1;j<=temp;j++){
            trp->b = (trp->b+trp->a)%l1;
            while (trp->b>=parameter->L)
                trp->b = (trp->b+trp->a)%l1;
            mat[i+parameter->S+parameter->H][trp->b] = 1;

        }*/
        raptor_getLTrow(parameter->L,mat[i+parameter->S+parameter->H],trp,l1);
    }
    free(trp);
    trp = NULL;
}

static void raptor_getLTrow(uint32 L, uint8* input, triple trp,uint32 l1){
    uint32 temp,j;
    while(trp->b>=L)
        trp->b = (trp->b+trp->a)%l1;
    input[trp->b] = 1;
    temp = (uint32)min(trp->d-1,L-1);
    for(j = 1;j<=temp;j++){
        trp->b = (trp->b+trp->a)%l1;
        while (trp->b>=L)
            trp->b = (trp->b+trp->a)%l1;
        input[trp->b] = 1;
    }
}

void raptor_parameterfree(RParam parameter){
    uint32 i = 0;
    for(i = 0; i<parameter->Amat->row; i++){
        free(parameter->Amat->rowpoint[i]);
        parameter->Amat->rowpoint[i]=NULL;
        free(parameter->A_1mat->rowpoint[i]);
        parameter->A_1mat->rowpoint[i]=NULL;
    }
    free(parameter->Amat);
    parameter->Amat=NULL;
    free(parameter->A_1mat);
    parameter->A_1mat=NULL;
}

void raptor_parameterfree(RParam_dec parameter){
    uint32 i = 0;
    for(i = 0; i<parameter->Amat_dec->row; i++){
        free(parameter->Amat_dec->rowpoint[i]);
        parameter->Amat_dec->rowpoint[i]=NULL;
    }
    free(parameter->Amat_dec);
    parameter->Amat_dec=NULL;
}

//公用函数
static uint8 deg(uint32 v){
    int j;
    for(j = 0; j<8; j++){
        if(f[j+1]>v)
            break;
    }
    return d[j+1];
}

static void trip(int K, int X, triple trp){
    int A,B,Y;
    int v;
    A = (53591+J[K]*997)%Q;
    B = 10267*(J[K]+1)%Q;
    Y = (B+X*A)%Q;
    v = rand(Y,0,1<<20);
    trp->d = deg(v);
    trp->a = 1+rand(Y,1,L1[K]-1);
    trp->b = rand(Y,2,L1[K]);
}

static uint16 gray_m(int j,float k){
    int i,count_1 = 0,count_j = -1;
    uint16 temp,gray;
    for(i = 1; i<=8192; i++){
        count_1 = 0;
        gray= (uint16)(i^(uint16)floor(i/(float)2.0));
        temp = gray;
        //printf("%d\n",temp);
        while (temp!=0){					//计算所求gray数的二进制表示中1的个数
            //printf("%d\n",temp);
            if((temp&1)!= 0)
                count_1++;
            temp = temp>>1;
            //	printf("%d\n",temp);
        }
        //printf("%d\n",count_1);
        if(count_1 == k)
            count_j++;
        if(count_j == j)
            break;
    }
    return gray;
}

static uint32 rand(int x,int i,int m){
    uint32 temp;
    //	printf("m:%d\n",m);
    temp = (V0[(x+i)%256]^V1[((x/256)+i)%256])%m;
    return temp;
}

static void my_xor(uint8 * x, uint8 * y, uint32 size){  // 计算X^Y, 结果保存在X中
    uint32 i;
    for(i = 0; i < size; i++)
        x[i] ^= y[i];
    return;
}

void raptor_free(uint8* pointer){
    free(pointer);
}
